DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `spFlexiTimeIntegrator`(
dateFrom varchar(45),
dateTo varchar(45)
)
BEGIN
DECLARE ErrorMessage VARCHAR(3000);
DECLARE vPIID INTEGER;
DECLARE vDTR_Date DATE;
DECLARE vflexSchedID  INTEGER;
DECLARE no_column_recs INTEGER DEFAULT 0;
DECLARE lst_flexi_dtr CURSOR FOR 
		SELECT piid,DTR_Date,flexSchedID
		FROM tbl_flex_dtr
		WHERE DTR_Date BETWEEN dateFrom and dateTo
		ORDER BY PIID, DTR_Date;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET no_column_recs=1;
DECLARE EXIT HANDLER FOR SQLEXCEPTION
     BEGIN
     SET ErrorMessage= 'An error occurred while saving information.';
      SELECT ErrorMessage;
     ROLLBACK;
     END;
SET ErrorMessage='';
  DROP TABLE IF EXISTS tbl_flex_dtr_temp;
  CREATE TEMPORARY TABLE tbl_flex_dtr_temp(
	PIID BIGINT(10),
	DTR_Date DATE,
	flexSchedID BIGINT(20),
	`1_timeIn` VARCHAR(10),
        `1_timeOut` VARCHAR(10),
        `2_timeIn` VARCHAR(10),
        `2_timeOut` VARCHAR(10),
        `3_timeIn` VARCHAR(10),
        `3_timeOut` VARCHAR(10),
        `Undertime` VARCHAR(10)
);
SELECT b.PIID,b.DTR_Date,b.flexSchedID,b.1_timeIn,b.1_timeOut,b.2_timeIn,b.2_timeOut,b.3_timeIn,b.3_timeOut, b.Undertime
		FROM tbl_flex_dtr b
		WHERE DTR_Date BETWEEN dateFrom and dateTo
		ORDER BY PIID, DTR_Date;
OPEN lst_flexi_dtr;   column_loop: LOOP
FETCH lst_flexi_dtr INTO vPIID,vDTR_Date,vflexSchedID;
      
IF no_column_recs=1 THEN
    LEAVE column_loop;
END IF;
