SET `1_timeIn` = vPIID
WHERE PIID = vPIID and DTR_Date = vDTR_Date;
UPDATE tbl_flex_dtr_temp
SET `1_timeOut` = vDTR_Date
WHERE PIID = vPIID and DTR_Date = vDTR_Date;
UPDATE tbl_flex_dtr_temp
SET `2_timeIn` = vflexSchedID
WHERE PIID = vPIID and DTR_Date = vDTR_Date;
END LOOP;
CLOSE lst_flexi_dtr; 
END $$
